import React from "react";
import Digital from "./../img/Digital.png";
import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';
import InstagramIcon from '@mui/icons-material/Instagram';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
// import {
//     Nav,
//     NavLink,
//     Bars,
//     NavMenu,
//     NavBtn,
//     NavBtnLink,
//   } from './NavbarElements';
import { NavLink as Link } from 'react-router-dom';
// import LinkedInIcon from '@material-ui/icons/LinkedIn';
// import InstagramIcon from '@material-ui/icons/Instagram';
import './../css/Header.css';
// import {LinkedIn} from '@material-ui/icons';
// import green from "@material-ui/core/colors/green";

function Header() {
    return (
        <div className="head">
            <div className="top">
                <div className="left">
                    <p>Company Email will be here</p>
                </div>
                <div className="logo" >
                    <img src={Digital} alt="Digital" style={{ width: "300px", height: "120px" }} />
                </div>
                <div className="social" >
                    <a href="#"><LinkedInIcon className="icon" /></a>
                    <a href="#"><FacebookRoundedIcon className="icon" /></a>
                    <a href="#"><InstagramIcon className="icon" /></a>
                </div>
            </div>
            <div className="navbar">
                <Nav>
                    <Bars />

                    <NavMenu>
                        <NavLink to='/about' activeStyle>
                            About
                        </NavLink>
                        <NavLink to='/events' activeStyle>
                            Events
                        </NavLink>
                        <NavLink to='/annual' activeStyle>
                            Annual Report
                        </NavLink>
                        <NavLink to='/team' activeStyle>
                            Teams
                        </NavLink>
                        <NavLink to='/blogs' activeStyle>
                            Blogs
                        </NavLink>
                        <NavLink to='/sign-up' activeStyle>
                            Sign Up
                        </NavLink>
                        {/* Second Nav */}
                        {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
                    </NavMenu>
                    <NavBtn>
                        <NavBtnLink to='/signin'>Sign In</NavBtnLink>
                    </NavBtn>
                </Nav>

            </div>
        </div>
    )
}

export default Header;
